const uploadDocuments = multer({
    dest:'images',
    limits:{
        fileSize:1000000

    },
    fileFilter:(req,file,cb)=>{
    if(!file.originalname.match(/\.(doc|docx)$/)){
       return cb(new Error('Please upload a document'))
    }
      cb(undefined,true)
      cb(undefined,false)
    }
})

